import React from 'react';
import '../css/home.css'
function Home(props) {
    return (
        <div className='box-check'>
            <div className='d-flex justify-content-between '>
                <button type="button" class="btn btn-info text-white">Check in</button>
                <button type="button" class="btn btn-danger text-white">Check in</button>
            </div>
        </div>
    );
}

export default Home;
